import React, { Component } from 'react';

//props: 
// key (id)
//  id
// home
//  away
//  date
//time
//  timezone
//  location
//  stadium    
//home img
//away img  

class EventTab extends Component {
    //in class eventTab
    render() { 
        return (
            <React.Fragment>
                    <div class="match-up flex-item-eventTab">
                        <div>
                            <img src={this.props.homeImg} class="home-img"/>
                            {this.props.home} 
                        </div>
                         <div>vs</div>  
                         <div>
                            <img src={this.props.awayImg} class="away-img"></img>
                         </div>

                        {this.props.away}
                    </div>
                    <div class="btn-container">
                        <button class='flex-item-eventTab'>Add game</button>
                    </div>


                    <div class="location flex-item-eventTab">
                        {this.props.stadium} {this.props.location}
                    </div>

                    <div class="time flex-item-eventTab">
                        {this.props.date}  at  {this.props.time}
                    </div>

            </React.Fragment>
        );
    }
}

export default EventTab;
